import EachItemCost from "./Calculations/EachItemCost";
import FinalPersonTotal from "./Calculations/FinalPersonTotal"

const Form = (props) => {
    return (
        <div>
            <EachItemCost 
                expenses={props.expenses}
                persons={props.persons}
                updateItemCost={props.updateItemCost}
                updateTotalEaten={props.updateTotalEaten}
            />
            <span>Hello</span>
            {props.persons.map((person) => {
                {console.log(person)}
                <FinalPersonTotal
                    key={person.id}
                    name={person.name}
                    total_oweing={person.total_oweing}
                />
            })}
            <span>Hello</span> 
        </div>
    )
}

export default Form;
